  },
  // ÿ£ŸäŸÇŸàŸÜÿßÿ™ ÿßŸÑÿ≠ÿßŸÑÿ© (ÿßÿÆÿ™Ÿäÿßÿ±Ÿä ‚Äî ÿπÿØŸëŸÑ ÿßŸÑŸÇŸäŸÖ ŸÉŸÖÿß ÿ™ÿ≠ÿ®)
  statusIcons: {
